{"time": "18:03 26/06/2020", "content": "THÔNG BÁO VỀ CA BỆNH 353 (BN353): Bệnh nhân nam, 31 tuổi, địa chỉ tại Phùng Xá, Thạch Thất, Hà Nội. Ngày 24/06/2020, hành khách này từ Cameroon quá cảnh Nigeria, Ethiopia, Malaysia, nhập cảnh sân bay Tân Sơn Nhất ngày 25/6 trên chuyến bay VN9674. Sau khi nhập cảnh, người này được cách ly tập trung tại Bệnh viện Quận 7, TP. Hồ Chí Minh. Ngày 26/6/2020, được lấy mẫu, xét nghiệm cho kết quả dương tính với SARS-CoV-2. Hiện bệnh nhân đang được cách ly, điều trị tại Bệnh viện Dã chiến Củ Chi.", "link": "https://ncov.moh.gov.vn/web/guest/dong-thoi-gian/"}
